import React, { Component } from "react";
import $ from "jquery";
import { findDOMNode } from "react-dom";

export class Contact extends Component {
  handleToggle = () => {
    const el = findDOMNode(this.refs.toggle);
    $(el).slideToggle();
  };

  render() {
    return <div className="contact-whole"></div>;
  }
}
